import React from "react";
import { Typography } from "@mui/material";

type PlaylistProps = {
  links: Array<string>;
}

function Playlist({ links }: PlaylistProps) {
  return (
    <>
      {links.map(link => (
        <div key={station.call} className='station'>{station.call}</div>
      ))}
    </>

  );
}

export default Playlist;
